import Item from "./item";

const datalist = ({Id, SelectData, setOption = () => {}}) => {
    function optionChange(e){
        setOption(e.target.value)
    }

    return (<div className="datalist">
        <input list={Id} onChange={optionChange} />
        <datalist id={Id} >
            {SelectData.map((item) => {
                const {Id, Name} = item;
                return (
                    <Item
                        Id={Id}
                        Name={Name}
                    />
                );
            })
            }
        </datalist>
    </div>)
}

export default datalist
